  false,\n\t\"url\": null,\n\t\"notes\": \"From 1999-2015, approximately 130,000 Atka
  mackerel have been tagged and released in the Aleutian Islands, Alaska, specifically
  at Seguam Pass, Tanaga Pass, Amchitka Island, Kiska Island, Petrel Bank, Buldir
  Island, Agattu Island and Western Aleutian Seamounts.  To date, over 2,600 have
  been recovered.  Tag releases were conducted aboard the chartered fishing vessels,
  Pacific Explorer and Morning star (2014), and tag recoveries were conducted aboard
  the chartered fishing vessel, Seafisher.  In addition, the Atka mackerel fishery
  provides a substantial amount of the tag recoveries in the areas open to fishing.
  \ Tagging procedures and recovery sampling are described in detail in McDermott
  et al 2005.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
